        for v1, v2 in adjacency_list.items():
            for v in v2:
                self.adjacency_matrix[v1][v] = 1
                self.adjacency_matrix[v][v1] = 1
    def is_cyclic(self) -> bool:
        visited = set()
        for v in range(self.vertices_number):
            if v in visited:
                continue
            if self.dfs(v, visited) == True:
                return True
        return False
    def dfs(self, v: int, visited: Set[int]) -> bool:
        if v in visited:
            return False
        visited.add(v)
        for i in range(self.vertices_number):
            if self.adjacency_matrix[v][i] == 1 and i not in visited:
                return self.dfs(i, visited)
        return True


